import { servicesImg } from "../costants/constants";

const About = () => {
  const ImgWrapper = ({ img, names }) => {
    return (
      <li className="about__item">
        <img className="about__picture" src={img} alt="" />
        <span className="about__name">{names}</span>
      </li>
    );
  };
  return (
    <section className="about">
      <h2 className="title about__title">
        Про нас <br /> Ukraine Support Fondation
      </h2>
      <p className="about__descr descr">
        Фонд» - громадська організація , заснована У 2022 році командою
        волонтерів.. Цiлi фонду назбирати максимальну суму на допомогу ЗСУ за
        мінімальний строк.
      </p>
      <p className="about__descr descr">
        Фонд» - громадська організація , заснована У 2022 році командою
        волонтерів.. Цiлi фонду назбирати максимальну суму на допомогу ЗСУ за
        мінімальний строк.
      </p>
      <ul className="about__list">
        {servicesIcons.map((icon) => (
          <IconWrapper key={icon.id} icon={icon.img} descr={icon.descr} />
        ))}
      </ul>
    </section>
  );
};
export default About;
